import React from "react";
import Navbar from "./Navbar";
import Hero from "./Hero";
import Services from "./Services";
import AstrologicalServices from "./AstrologicalServices"; // ✅ Import Here
import KundliSection from "./KundliSection"; // ✅ Import Here
import ZodiacWheel from "./ZodiacWheel"; // ✅ Add the Zodiac Wheel Section
import Footer from "./Footer";

const Home = () => {
  return (
    <div className="bg-black text-white">
      {/* ✅ Navbar */}
      <Navbar />

      {/* ✅ Hero Section */}
      <div className="mb-20"> {/* Adjusted Spacing */}
        <Hero />
      </div>

      {/* ✅ Kundli & Panchang Section */}
      <div className="mb-20"> {/* Adjusted Spacing */}
        <KundliSection />
      </div>

      {/* ✅ Zodiac Wheel Section (NEW) */}
      <div className="mb-20"> {/* Adjusted Spacing */}
        <ZodiacWheel />
      </div>

      {/* ✅ Astrology Services */}
      <div className="mb-20"> {/* Adjusted Spacing */}
        <Services />
      </div>

      {/* ✅ Astrological Services Section */}
      <div className="mb-20"> {/* Adjusted Spacing */}
        <AstrologicalServices />
      </div>

      {/* ✅ Footer */}
      <Footer />
    </div>
  );
};

export default Home;
